"reviewcomment":"This is shopping like it was 100 years ago and what a great retail experience.<br>The first thing that assails you, if you are very lucky, is the smell of coffee roasting which pumps out into the street from the machine in the window. The machine looks as though it should be is a museum and in a way it is. Martyn is stilll today, very much as shops must have been back at the turn of the century, (the previous century).<br>And the produce and service are fantastic. I have just topped up with loose Earl Grey tea and Ian Fleming&#39;s favourite; Wilkinson&#39;s little Scarlet strawberry jam. The change is handed to you through a little hatch. <br>Now wasn&#39;t shopping so much nicer back then!",
