"reviewcomment":"Great big thanks to Yee Gan O. for introducing me to Berry Bros!<br><br>On Yee Gan&#39;s recent visit to SF, he brought along a particular bottle of scotch I had not seen before. He mentioned that it was a gift for someone and that you could not get it here in the U.S. This, of course, peaked my curiosity and I knew that I had to come check it out for myself in London.<br><br>What an amazing shop! It&#39;s not like a liquor store I&#39;ve come to know at all. It is more like a winery of sorts, where there are well dressed men and women who are so knowledgable about liquor you would have never even heard of otherwise. They are actually the owners of the Glenrothes whiskey brand thus they make their own whiskey.<br><br>Oh yes, you heard me, they bottle their very own collection of whiskeys dating back to the 60&#39;s and 70&#39;s! You can find some incredibly complex and amazing flavors here at Berry Bros and they&#39;re more than happy to give you a taste with the cutest little glencairn glasses ever! <br><br>The whiskey here isn&#39;t cheap, but it certainly is incredibly rich. The history of the shop and the history of their whiskey is definitely an interesting tale while you wait for your bottles to be wrapped, and they can even give you a few pointers on whiskey if you&#39;re new to the concept. Fantastic and a must visit for any whiskey enthusiast!",
