"rating":"5.0",
"reviewcomment":"If you like cheese, then you need to be very, very careful coming here. You will find it impossible to choose, so you will simply buy many good cheeses. This is an amazing cheesemonger and there isn&#39;t a bad cheese in the place. They&#39;re attentive, knowledgeable and friendly. In addition to having a wonderful array of delicious cheeses, they&#39;ve got fine wines, accessories, sauces, and even fresh sandwiches (using their cheeses, of course).<br><br>I duck in and grab something--anything--and love it every time. You can get unpasteurised cheeses here, which Americans don&#39;t get very much. You can also find brilliant artisanal cheeses where you can learn all about who supplied the milk, who made the cheese, where it comes from, etc. You can practically learn the goats&#39; names.<br><br>If you&#39;re in the Piccadilly Circus / Jermyn Street area, this is absolutely worth stopping in.",
