"reviewcomment":"Amazing place! We always shop from here even though the prices aren&#39;t that low, but for the quality you receive I dare say they are pretty decent.<br>At first Macken Bros looks like your typical butcher shop, but in reality it is a place, where quality is the main word. The meat there is always fresh and everything is organic. On special occasions they offer for example turkey, lamb and burgers, which all taste delicious, but you have to wait for one since early morning hours. <br>The staff are all great too. You can clearly see that they are all very well trained and completely understand their work. Each one of them is willing to give you information or recommend you a certain type of meat.<br>It&#39;s our local butcher and each and every dish my fiancee has cooked with meat bought from here tasted delicious.",
