"reviewcomment":"I&#39;m not a coffee drinker, but I&#39;m giving it 5 stars anyway! <br><br>I needed a £10 secret santa gift for a coffee lover, and had no idea what to get him.  All I knew were the few different coffee beans he has, and thats about it.  But the guys in the shop were super nice!  <br><br>They gave me some suggestions based on what my coworker drank, and for £10, I came away with 2 x 125g pouches of coffee, and a 125g bag of dark chocolate covered beans.  I hate coffee but even they looked absolutely delicious, I went back and snagged a bag for myself--I mean for the coffee-loving bf as well :) <br><br>The prices here seem very reasonable, and they even sell an assortment of teas and spices!",
