"reviewcomment":"Now let&#39;s get one thing straight, in life... there&#39;s truffles and then there&#39;s truffles. These are the latter, delicious and reasonably priced, not to be confused with the former, which are overpriced (and still delicious). <br><br>Verde &amp; Co has been on my bookmarks list for ages, but a recent brunch encounter with the luminous Linzi M had left us with the need for a little coffee pick-me-up so the moment finally came to tick this one off my list. <br><br>If you&#39;re looking for hot chocolates or mochas, you need to stop in, it&#39;s absolutely perfect. There&#39;s a chocolate counter with some tempting little treats, so we tried a few... here&#39;s the verdict in case you haven&#39;t gathered... <br><br>Yum. <br><br>Lime + dark, cassis, pink peppercorn, you can&#39;t go wrong....also considering we&#39;ve been to other shops that stick on a more aggressive pricetag, these did the trick for a coffee companion. <br><br>There&#39;s not much space inside to sit, but you could always take yours to go and sit in Spitalfields and point at the hipsters. <br><br>Win-win, either way.",
