"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/qrIcnj8CSfT0_2MrhLimXw/l.jpg",
"rating":"4.5",
"reviewcomment":"Talk about being whisked back to my childhood! I remember the good old days where you could walk into a candy shop with a dollar, buy individual pieces of candy ranging anywhere from a penny to a dime, and leave with a bag so full that it made me feel like the richest girl in the world.  Well those days are long gone, at least in Chicago.  That's why I was so excited to try Mrs. Kibbles, when I read about it in Luois Vuitton's City Guide of all places.  Just as the book promised, this place did not disappoint! This sweet shop was something right of a fairy tale.  The colors, the clear apothecary type glass jars that displayed sweets galore, and the glass showcase full of goodies all crammed into the tiniest candy shop in the world pulled at the heart strings of the little girl buried deep within me.  <br><br>Everything that I sampled from the lemon and pear drops, the truffles, the gummy beer bottles were so yummy.  I really felt like a kid again, and there's no better feeling!",
