"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/RFg0pKHoP4ro3PmyqYCujA/l.jpg",
"rating":"4.0",
"reviewcomment":"People, go check out this cafe. One might think - it&#39;s just coffee, how good can it get and what&#39;s the big deal? But people, it&#39;s a big deal, because I am like the laziest Yelper ever, but my fingers were itching to type this review within a couple of hours of having the nicest, smoothest Flat White ever. I stumbled upon this place when I was in the area for a meeting so it&#39;s a shame that this can&#39;t be a regular haunt for me, but I do know that every opportunity I get to stop by this spot, I will make the most of it! Happy that my project requires me to be in the neighbourhood for at least another couple of weeks :P Definitely want to try out their cakes and cookies, they looked sumptuous... their afghan cookie looked particularly inviting!",
