"rating":"5.0",
"reviewcomment":"Dear god this place is utterly awesome! <br><br>It stands almost alone among the kebab houses and takeaways of the whitechapel road. Located just by the Whitechapel gallery and near Aldgate east station it is an oasis of great pastries, sandwiches and coffee. <br><br>Not just any sandwiches mind, oh no. these sandwiches will delight all those who try. Yes they are pretentious but in this case thats a good thing. The last time I was there I has smoked salmon with wasabi cream on olive bread with coffee and a cupcake for £8, not cheap but pretty good value for something so excellent. Indeed the food was so good I had to walk 2 miles to my meeting to burn it off!<br><br>Seriously this place is among the best places in the area and, dare i say it, most of London for the price.",
