"rating":"4.5",
"reviewcomment":"Pricey but amazing.<br><br>I saw Mr Young himself at Chocolate week a couple of years ago where he gave us free samples of his truffles. Since then, his chocolates have been a regular present for my choccie loving friends (you know, the posh ones who won&#39;t eat Green &amp; Blacks). Of course they only get about 4.<br><br>The brownie bites are amazing. As is their brownie, but go for the original... the salted caramel one is too sweet.<br><br>I also have his cookbook, which I have to say is a bit daunting with the amount of recipes for truffles in there that require me to temper vast quantities of chocolate (err, I think someone might need to show me that before I melt and destroy a kilo of the finest chocolate I have ever purchased in these quantities). The aztec cupcakes are delicious though, especially when you get your cocoa and cocoa nibs from here. Mind you, so they should be at these prices.<br><br>I recently went in for some ingredients and the shop assistant even went to speak to the chocolatiers (sp?) for some advice on how I could make my cakes even better. Now that&#39;s service.",
