"reviewcomment":"We stopped in here to get something to snack on while visiting London. In the USA it is illegal to eat unpasteurized cheese, and we were feeling a bit rebellious, so we were on the hunt for danger!<br><br>The cheesemongers here are EXTREMELY friendly and knowledgeable- they have such a clear passion for their craft, it&#39;s really refreshing. The two men who helped us on this particular day let us sample more than enough product, and told us all about each of the cheeses we were trying. It was such a fun, relaxed atmosphere. And everything is moderately priced, especially considering how high quality their product is.<br><br>There&#39;s something special about a place like Neals Yard- where the conversation trumps  how much you&#39;re spending. They&#39;re just committed to really great food- you can&#39;t imitate that.",
