"rating":"5.0",
"reviewcomment":"After eating here, I&#39;ve become convinced there is a god, and he is Mexican.<br><br>The cochinita pibil is just amazing. I was very skeptical as I kept hearing that it&#39;s cooked in orange juice, which I&#39;m not fond of, but it&#39;s really really lovely and spicy and you really probably have not tasted anything like it. I sure haven&#39;t. It&#39;s really good value, a meal box for £6 and you can have 2 fillings if you like or just load up on that lovely cochinita pibil, or 3 tacos I believe for the same price. Very filling but definitely savour it because you&#39;ll probably want more :) I can&#39;t stop thinking about it! They don&#39;t always have the cochinita on so count yourself lucky if they have it when you go. It&#39;s probably the best thing I&#39;ve ever eaten.",
