"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/owc1pqjg5WAjjBvMEKb1dA/l.jpg",
"rating":"4.0",
"reviewcomment":"One word: CRONUT.  Sure they&#39;re shipped over from another restaurant spot, but people like myself and fiance were so desperate to have a cronut, we didn&#39;t care where it came from.  Paired nicely with a nice hot latte on this brisk October morning, we absolutely enjoyed each bite of this wonderful cronut that was filled with cream!  Greg and I thought that places like Wild &amp; Wood are virtually non-existent in cities like San Francisco and New York, as most cafes make coffee-making a grand production. Wild &amp; Wood keeps it simple, and we really appreciated it.  Good place to stop off if you&#39;re on your way to the British Museum!",
