"reviewcomment":"When I lived in Marylebone, I went here every single Sunday. They have a little bit of everything. Veggies, fruits, baked goods, dairy, etc. They also have cooked food (tarts, bread, sandwiches, pastas, etc.) for sale. Fantastic. The vendors are funny and approachable, and can tell you a lot about what they are selling. If you&#39;re in the area, check it out, and then go to La Fromagerie and The Ginger Pig for some other great snacks and groceries. Marylebone High Street also has some great food spots. All and all, great market. Not as big and busy as Borough, and still a great stop.",
