"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/iMfaefPekjy616ejkQFqeg/l.jpg",
"rating":"4.5",
"reviewcomment":"A dangerous, but utterly fantastic place! - Dangerous, because you run the risk of getting fat. Fantastic, because it&#39;s like a miniature version of custard heaven.<br><br>The patisserie/bakery is part of a little Portuguese ghetto - with the Lisboa Delicatessen shop right across from it and a little Portuguese stationary shop right next to it. Don&#39;t expect anything posh or fancy - it&#39;s a down-to-earth bakery, where real people eat real custards, so to speak. <br><br>In order to make the best out of this place, I suggest two options: <br><br>1) You come here on multiple occasions, as there&#39;s so many different things that will tempt your palette. You simply can&#39;t eat all of it in one visit, but you simply have to try most of it!<br>2) You talk to your bosses and persuade them to host a Portuguese Happy Hour - that way you can buy a variety of lots of different pastries and you get to sample a lot! (This was the option that I went for.)<br><br>I really love this place - but I suggest you come by on a non-weekend day, as the crowds are simply off-putting.",
