"rating":"4.0",
"reviewcomment":"The tea lover in me had to make sure that a stop by Twinings was in order during our recent stop in London. It was not exactly what I was expecting (I guess I was expecting something more like a tea house), but it was well worth the visit. It really is a must see for tea people. The store is tiny, but the assortment of teas available (both in bags and loose leaf) is pretty incredible. <br><br>Towards the back of the shop, you can see some older advertisements and artifacts from the store&#39;s great history. There&#39;s also a little bar where you can try the teas that they&#39;re offering. The set up they had was pretty cute and the service there was great. <br><br>We stopped by London at the end of our travels, so we were very low on bag space at that point. Otherwise, I definitely would have gotten some of that delicious first flush Darjeeling tea I tried. Maybe next time.",
