"reviewcomment":"I&#39;ve been coming here for a while now - every Sunday around 11:15, grabbing a cinnamon bun or coffee while we wait for them to bring out lunch. I don&#39;t know much (anything) about Scandinavian food but YESSSSSSS! Their beetroot salad and sweet potato salad are ace. Not to mention the little bits of fried onion and dollop of mustard on their roast beef / salami on rye things (I don&#39;t even know what they&#39;re called, sozz, but they taste real good). Big yes on the Smørrebrød and kladdkaka! I&#39;ve had better cinnamon buns but these aren&#39;t too far off. Although for coffee it&#39;s probably best heading to Kaffeine across the road - not a fan of super milky coffee!<br><br>Popped in last week and they&#39;ve recently schnazzed up the place! The counter&#39;s all done up now - in super slick black and  salads in big wood bowls. Also noticed that they sell violet liquorice!! A box for 75p maybe? Not even a liquorice fan but trust me, these&#39;ll win you over too.",
