"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/MNsvBDagAzHneY-MCi6-fQ/l.jpg",
"rating":"4.5",
"reviewcomment":"Holy smokes. I&#39;m already a fan (Nopi is amazing and one of my favourite restaurants in London), and have had lovely food from the original Notting Hill shop.<br><br>The Motcomb Street location has all the things I love about the Notting Hill one, but it&#39;s far quieter and doesn&#39;t feel so hectic. Equally busy, but I just preferred it.<br><br>Yes it&#39;s expensive (£15 for a protein and three salads if you eat in) - but you&#39;d pay that in London for a fancy burger, so why not this? It&#39;s worth every penny in my eyes. Portions are decent and quality is top notch.<br><br>Salads change daily but the meats largely stay the same (grilled salmon, beef fillet, spicy chicken, seared tuna). Takeway salad   boxes sold by weight. The chargrilled broccoli with garlic and chilli is a must.<br><br>Cakes are insane. Had a flourless almond and orange cake with dark chocolate ganache today. ZOMG. You won&#39;t be sorry :)",
