"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/xPNHpW6iYVGQ_FWtWpF1kQ/l.jpg",
"rating":"4.5",
"reviewcomment":"24 hours a day 7 days a week. Drooling thinking about it!!! If you are on Brick Lane you must go here. <br><br>The bottom line: chewy soft plain bagels (not toasted) but gooey oozy yummy goodness with hot fatty salty beef (corned beef as we know it). Not the sliced kind, the kind they take a big fat chunk of, stick in a bagel with some mustard and you stand not the street and eat it, and then want to go back for more. Maybe a 2nd one? 3rd one? It&#39;s a no frills kind of place, no seating. There was a line but it went quick and they worked like a well oiled machine. The workers were quick and within seconds-BAM in my tummy!Thank goodness I am very far away from here, or I can see myself being very very very addicted.",
