"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/GRWRQDBKrxbhh7Y2y_t13Q/l.jpg",
"rating":"4.0",
"reviewcomment":"So... It happened I was walking around, looking for another place to have my late coffee on a Sunday afternoon and suddenly, a group of people stepped out of a door that led to an alley that led me to J+A Café.<br><br>There are two buildings, one on each side of the alley. One of them is a coffee shop where you can have brunch/lunch and the other, apparently, is a bar. I just went to the &#39;restaurant&#39; part because all I wanted was some coffee and cake.<br><br>The place is really nice, airy and bright, with simple decoration. The staff was lovely, always with a smile on their faces even though it was almost closing time. Always appreciated.<br><br>Brunch was over when I arrived, so I didn&#39;t have a chance to try the food. But I did try the cakes and they were wonderful. I had the Chocolate Guinness Cake with Baileys and clotted cream on the side and I just have one word to describe it: MARVELLOUS!<br><br>The coffee was also really good. Much better than the one you will get for the same price in any high street chains.",
