"reviewcomment":"I always come to Harrods food hall whenever i&#39;m in London because i like to just walk around and look at all the delicious food and if i&#39;m hungry, i love to pick up a few nibbles. They also sell lovely chocolates that are super to take home as presents as they wrap them up in delightful boxes with ribbon.<br><br> Some items are quite expensive but that is to be expected really - however there are lots of affordable gift if you&#39;re a tourist on a budget.",
