"reviewcomment":"I am feeling in quite the good mood today. However, don&#39;t think that I am just being generous to this little cafe. It might be little but they serve big breakfasts inside. The Full English is a real bargain at 3.50 and comes with all of the important pieces - thick, delicious sausage, crispy bacon and heavenly beans. Those were the first three things that got cleared out of my plate and by the time I finished up I was absolutely fueled for my day ahead.<br><br>The place is quite comfy and welcoming, with a big board for all the specials and lots of cute tables, spread around.<br><br>In addition to being a great breakfast spot, the guys here also have amazing sandwiches for lunch. Enormous and heavily stuffed with goodness, they&#39;re a good choice if you&#39;re starving.",
