"reviewcomment":"I love them. So much so, I had a whoopie pie from them on sunday and then stormed to their stall at canary wharf kerb on tuesday. I mean stormed, I know what I want. <br><br>I wasnt too keen on their crodoughs, because the toffee I had seemed a bit off but their whoopie pies are very good. Also proper american sized, the stall owners are always so friendly! (not to say british ones arent but in comparison!...)<br><br>It&#39;s a regular at sunday upmarket and its one the better bake stands I have come across, i mean, I still have yet to pick the courage to order a shiny gold ferroro rocher whoopie pie because it so monstrous (ly yummy)",
