"rating":"4.0",
"reviewcomment":"So Tinker II is a zippy little thing but unfortunately last weekend she got a flat and I had to sort her out with a new front shoe. I rolled here into Lock 7 bright and early on Sunday and within 5 minutes we established that it was not just going to be inner tubes but a whole front tyre that needed replacing. I left my number and they said they would call me when it was done.<br><br>less than 30 minutes later I have a little voicemail on my phone. Tinker II is ready for collection. I parted with my £26 and rolled out of there a happy cyclist. Since then I have popped in again when I needed a new rear light. £12 later I have just what I need after some friendly advice.<br><br>These guys are great. They run an efficient shop that can turn around repairs quickly. It&#39;s not the cheapest but it won&#39;t break the bank either. They also serve up food and drink and I&#39;ve yet to try the coffee but I hear good things.",
