"reviewcomment":"I wandered lonely like a cloud...<br><br>Nope, actually I ran-walked into Long White Cloud in a rush since I was uber-late. This place is an oasis of cute Kiwi attitude in the middle of the often times dubious Hackney Road. It&#39;s bigger than it looks from the outside with plenty of seating and big chalkboards to order from. <br><br>These Kiwi coffee masters are always wasted on me as I drink americanos and not long blacks, but my coffee was good, and strong. Trays of savoury pastries and cakes were calling out to me as I waited, &#39;eat us, Linzi&#39;, don&#39;t we look delicious?&#39; <br><br>Quiet, pastries, I won&#39;t tell you again. <br><br>The brunch menu looks amazing and I am dying to go back and try it. They always have a wall of New Zealand treats that you might be missing from back home.",
