"reviewcomment":"I really like this Japanese market. I find the Japan Centre too crowded to shop comfortably at, and Arigato has most of the same products and they are usually a less expensive. They also have a fair amount of Korean products and frozen foods. Arigato is particularly good if you are looking for ingredients for making your own food, although they do have a lot of ready-to-eat hot foods as well. <br><br>The last time I was Arigato I went to the counter and realized I had forgotten my wallet. They saved everything behind the counter for me and seperated my frozen and refrigerated stuff and waited an hour and a half for me to come back. They were really nice and  didn&#39;t even make me feel like a complete retard about it.",
