"reviewcomment":"Lovely place for afternoon tea at the Langham. Large selection of teas as well as several different afternoon tea menus that cover the whole range of traditional to innovative. <br><br>Ordered the Wonderland Tea; finger sandwiches were all tasty, as were the scones with clotted cream and strawberry preserve. The desserts were a bit more interesting and creative, and quite tasty as well. <br><br>Staff were all excellent; their attentiveness, professionalism, and warmth made having tea here (and staying at the hotel in general as well) an absolute pleasure. <br><br>The room is elegantly decorated, with touches of more traditional furnishings yet still modern. There&#39;s also live piano music, which was nice. <br><br>Also ate continental breakfast here almost every day during my stay at the hotel. Good selection of hot and cold items, including scrambled eggs, roasted tomatoes, bacon, smoked salmon, yoghurts, cereal, toast, fruit, and assorted pastries. Fresh-squeezed orange or grapefruit juice and coffees and teas are included as well, with the option to order à la carte items as well.",
