"rating":"4.5",
"reviewcomment":"It&#39;s pretty well known that those on Qype are a big fan of Cyber Candy. Don&#39;t get me wrong, I&#39;m a big fan of the american goodies you can find in there, but it&#39;s all a bit new fangled for my liking. I like my sweeties of the old school variety. Cola bottles. Pear drops. White chocolate mice.<br><br> Mr HUmbug has big sweet jars right up to the cieling! like in the old days at the newagents when I&#39;d count all my coppers and ask for a 1/4 of pear drops. That&#39;s what sweet buying should be about! It&#39;s exciting to be able to do it again!<br><br> It is more expensive. You&#39;ll be saying to your friends stuff like &#39;but it only used to be 30p a 1/4&#39; and sounding a bit old. But there&#39;s enough stuff here to find something you like. I have an addiction to jazzies. Y&#39;know those little white chocolate discs with the candy coloured balls on them? I&#39;ll actually eat them until I feel sick. I can buy them here. This makes me deliriously happy. Or maybe I&#39;m just hyped up on sugar.<br><br> They make for good presents too. They&#39;re a great way of saying &#39;Sorry I was a bit of an idiot last week&#39;. It&#39;s cute and not an embarassingly large gesture.<br><br> So come here and eat sweets. Probably best enjoyed with a beer in the pub opposite. Which you weren&#39;t allowed to do in the old days.",
