"rating":"4.0",
"reviewcomment":"Ben&#39;s Cookies is one of the best kept secrets in London and they&#39;re the best cookies I&#39;ve ever tasted.<br><br> It&#39;s tucked away in a little corner of Covent Garden and I must have walked past it plenty of times without noticing it before my sister showed me the light. Since then I&#39;ve passed on the favour to many others.<br><br> The cookies themselves are incredible. There are plenty to choose from but I recommend the chocolate flavours - milk chocolate, double chocolate and triple chocolate. They&#39;re not cheap (around £1.20 for one, depending on weight) but they&#39;re worth every penny. And if you buy a box of 7 you only pay for 5.<br><br> If you can try to get them fresh out of the oven. The chocolate is warm and gooey and no cookie has ever tasted so sumptuous. They&#39;re still great even when they&#39;re cold, but if you take them home don&#39;t be afraid to put them in the microwave for a few seconds to try and replicate that just-baked taste.<br><br> These are the most amazing cookies you will ever taste and I can&#39;t recommend Ben&#39;s highly enough. I was thin before I found this place.",
