"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/VKrbFfUIGKa-s5uNiBn7ow/l.jpg",
"rating":"4.0",
"reviewcomment":"A great place for lunch in Shoreditch! I guess this place is also related to the popular Lantana in Fritzovia, but after my experience today, I definitely prefer Salvation Jane.<br><br>I got the aubergine and mozzarella tart and sweet potato soup-both of which were their specials of the day. Both dishes were really delicious and it only came out to 10 pounds, so definitely keep your eye out for their specials board.<br><br>Staff was also really friendly and helpful; our server was willing to answer all of our questions about the menu and he even put up when we were taking forever with splitting the bill. He also gave us free extra pieces of bread and a refill on our tea when we asked! <br><br>The lunch rush is pretty crazy, but  getting a table wasn&#39;t too bad on a Wednesday afternoon; if you prefer quiet places, it usually clears out by 2pm so this place is the place for you, too.",
