"rating":"4.0",
"reviewcomment":"How dare anyone disparage my fav all-time Cinnabon location. This place consistently has the freshest and best rolls this chain can deliver. OF COURSE, OF COURSE, OF COURSE you have to only get the classic rolls, no location cycles through the chocolate or pecan ones fast enough for those to be dependably fresh. <br><br>There are few things more disappointing than a not perfectly fresh Cinnabon, a sadness I&#39;ve experienced far too many times in airports across the USA, but not here. If you are going to get a four pack force them to cut ones from the main tray, those pre-made boxes of four are for jokers (yes I was once duped).<br><br>In fact I recommend haranguing the staff, sometimes necessary, until they report on/guarantee the freshness. Fresh Cinnabons are like cold beer and crisp chips in that they completely loose their reason for existence if their modifier is not fully up to snuff.",
