"reviewcomment":"This is my favourite bakery in London and my first port of call when in Crouch End. As others have said, it&#39;s an old-fashioned family bakery which produces a lovely - and extensive - selection of cakes, pastries and bread, much of which is difficult to find elsewhere. While some of it - particularly the large cakes - can seem quite pricey, the delicious sunflower seed bread and soda bread are little treats and well worth the price. The staff are always friendly and the premises are spacious enough to allow you to have a wander and make your choice without feeling under pressure from the staff.<br><br> It&#39;s worth saying that several of their breads and cakes are sold in Budgens across the road, so if you cannot get to Dunns during their opening hours of 6-6, their delights are on offer until 10pm at the supermarket.",
