"reviewcomment":"Samper is Superb!<br><br>Being in the wine business, it&#39;s not easy to impress me, but I really like The Sampler.<br><br>This concept was attempted in SF (Vino Venue) and it failed miserably. Here in the UK it seems to be working.<br><br>The staff is super friendly and knowledgable and they even allow little Napoleon (the Frenchie) inside. <br><br>Bottles are rotated frequently in the sampling cabinets and it&#39;s great to have the option of different tasting sizes. <br><br>They have high-end wines on sale, but also great affordable selections, many of which I have purchased myself. <br><br>I will continue to purchase my every day drinking wine at The Sampler and look forward to expanding my wine knowledge there.",
