"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/IlllKRlwqHtYpNrW3uOyWQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Hmm, what can I say about Gelato Mio?<br><br>How about wonderful, magnificent, terrific, phenomenal, and fan- FREAKIN-tastic?<br>Paciugo? Ha! I scoff at your so called &#34;gelato&#34;. Enter Gelato Mio and you enter a world of light, fluffy, flavor filled, REAL gelato that will make you forget where you are (literally, the walls disappeared around me as I ate my gelato).<br><br>The place was bustling each time we walked by (we visited Notting Hill on two separate days). It&#39;s a cute store front shop with additional seating downstairs.<br>I got two flavors, mango and pistachio, and my friend got the peach and nocciola (hazelnut) gelati. Forget the mango and peach. The nocciola and pistachio are hands down the best! Especially the nocciola. I probably sampled more of that than I should have from my friend.<br><br>I&#39;m sure if I ever go to Italy, I&#39;ll be even more blown away by their gelato, but in London at least, it&#39;s a little piece of Italia.<br><br>The crowds of fellow gelato eaters make it exciting to be there, and I got a &#34;Ciao bella&#34; from the cute worker as we left, so that was nice. :)<br><br>If you ever find yourself on Portobello Road, this is a MUST stop.<br>Oh, I wish I had some right now.",
