"reviewcomment":"I stumbled upon this place on Friday night and am a huge fan. It&#39;s a cozy Italian restaurant with the hustle and bustle of Soho that makes it perfect for a dinner before a night out. The food is Italian with an emphasis on pizza (HUGE portions). It is dimly-lit and buzzing, making it a great place to get together with friends or for a date. <br><br>The food was very good and the value was excellent. Mains averaged £10 and they had very reasonably priced wine on offer. Service was great. <br><br>I would say if you&#39;re looking for a fun spot before a night out that won&#39;t break the bank, this should be your go-to.",
