"reviewcomment":"This review is specifically for the chorizo rolls they sell right next to the shop, and not the shop itself.<br><br>An absolute MUST TRY if at borough market. I don&#39;t really eat chorizo rolls, so saying this is the best chorizo roll I&#39;ve ever had doesn&#39;t quite carry the same weight it would with most other foods. Nonetheless, this is one of those dishes where you immediately know it&#39;s the gold standard.<br><br>Chorizo, red pepper, rucola, all in a nice floury bun with generous amounts of extra virgin olive oil. I&#39;m not sure if I&#39;m doing it justice in my description but I&#39;m salivating as I write this - that&#39;s how much of an impression it made on me.",
