"reviewcomment":"wow, i think i am giving out too many 5 stars in London.<br><br>The cinnamon bun was amazing! GET THAT, or else you can never say you enjoyed the best cinnamon in the world. Its better than the cinnamon bun from cinabon yes i am comparing it to a chain store, but thats what i grew up with. Soft cinnamon buns with extra frosting, but the cinnamon bun at gails, was absolutely fabulous. <br>Gosh, it looks like the uglies cinnamon bun in the world with a huge tail sticking out from the bottom, but its so good. Its like two different worlds combined into one bun, crispy on top, and soft gooey, cinnamoness on the bottom. How did the baker do this???? I dont know, i wish i had the recipe, so i can make this. <br>I don&#39;t need the extra frosting!! I have graduated from cinnamon bun school, no extra frosting needed.",
