"reviewcomment":"Who would have thought that a generic American chain would do the best doughnuts I have ever tasted?<br><br> The shop is actually more of a stand and it&#39;s a little out of the way, but if you&#39;re lucky enough to find it make sure you don&#39;t pass it by without buying a box of doughnuts. The doughnuts aren&#39;t particularly cheap (around £1.20 for one), but a box of 12 is much better value and a double dozen is even better yet.<br><br> There are plenty of flavours to choose from - I&#39;ve tried most and my favourite is still the maple glazed. If you ever want to become extremely rotund, this is one of the best places to do it.",
