"reviewcomment":"I stumbled in to the Tea House quite by accident as I strolled through Covent Gardens. As a tea lover, I was intrigued at the quaintness of the exterior. Once inside however, my eyes were simply overwhelmed (in a good way) at the selection of teas, tea accessories, and all things tea related. <br><br>The salespeople were quite nice, and glad to explain the differences of the teas and provide a taste test for you. This place was cozy inside, and larger than one might expect once inside the store. There are simply walls of tea and more walls of tea items to brew the perfect cup. <br><br>I came away with orange oolong and jasmine flower tea; two of my favs. While the prices are not cheap, you are getting quality tea leaves....nothing quite like it in the states unless you visit a chinese tea shop. Even then, your choices will likely be limited when it comes to whole leaf teas.",
