"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/pi5HuVouyuey36facBm9oQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Superb! <br><br>I&#39;m not really a French food fan. Well actually, I&#39;ll eat (mostly) anything, but it&#39;s more that French food is not on my top 5 list of go-to foods / restaurants. In fact it&#39;s probably not on my top 10 list!<br><br>However that said I very much enjoyed Comptoir Gascon&#39;s offerings. We went for the lunch special which is very reasonable at £14.50 for two courses. I thought &#34;as I&#39;m here, lets go a little crazy!&#34; I started with the pig&#39;s trotter cake and tartare sauce. Of course it wasn&#39;t like eating a knuckle sandwich, nor was it like eating toe nails (as one would imagine). I&#39;m not actually sure which part of it had the pigs feet in it because it was more like a cross between a hash brown and a potato rosti. Come to think of it, perhaps it was more like a potato cake. Not withstanding, it was surprisingly very tasty and I&#39;m always impressed when dishes are seasoned well. I know that might sound a little odd, but I believe getting seasoning right is key - salt and pepper on a dining table (generally) should be redundant, but I appreciate people have different tastes too.<br><br>So my first try of pig feet cake was a score, and to follow in the &#34;dirty food&#34; theme I had going on, I opted for the mussels marinières and French fries to follow. Also very good and another score. <br><br>If I were in the area, I would definitely go back, and I would also give it a thumbs up if anybody wanted to take me there for lunch. Anyone? Anyone? Fine, I&#39;ll just cry wee wee wee, all the way home.",
