"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/8Ecd7j4sAddq9BwdwvSi2A/l.jpg",
"rating":"4.5",
"reviewcomment":"It&#39;s taken a little time to get going since this pub was bought and refurned by the eponymous Mr Hooper, but we are now at a stage where it has really bedded in and started to become what I rather hoped it would become, a proper community boozer of the old school.<br><br>The refurb was definitely of the less is more variety, keeping that wonderful victorian style central bar and many of the old fixtures and fitting including a snug!<br><br>The main reason to come (well shouldn&#39;t it always be for a pub) is the beer though. Brilliant selection of bottled beers from all over the world and a good turnover of guest ales. Bar staff are friendly and pretty much know most customers by name.<br><br>Also a good variety of musical nights, pub quizzes and beer or even cider festivals. For a new kid on the block I must say, top marks.<br><br>*ps, not really a DJ, more bar staff piping their iPods, but good taste nevertheless.",
