"reviewcomment":"A very distant relation  T H Heathcote, whose portrait <br><br>hangs on the staircase  was the pastor here when<br><br>Thomas Coram,&amp; G F Handel were involved in caring<br><br>for these poor wee souls. It is heartbreaking to hear<br><br>of the mothers giving their children up because they were too poor to keep them.Many of them died.<br><br>(Let us not forget this still happens in many countries of the Far East &amp; Africa today)<br><br>I love the fact that locals fought to keep the space for children in perpetuity<br><br>from the hands of greedy developers. I suspect the fight will be on again one<br><br>day in the not-too-distant future",
