"reviewcomment":"This place would get 5 stars if it had better prices!<br><br>The food they have there is great to pick up quickly between class, but really can&#39;t be frequented every day because it might set you back. The prices aren&#39;t terrible, but sometimes the portion doesn&#39;t fit the price. Also, their hot chocolate is deplorable.<br><br>It really should have wifi...and it really doesn&#39;t. What coffee places don&#39;t have wifi these days? Psh.<br><br>ONTO THE POSITIVES. They have absolutely amazing large chocolate covered donuts that will blow your pants off. These are fantastic! Their sandwiches are quality as well and they have many nice Italian baked items. They have this garlic bread-type thing which has the texture of a churro but is shaped like a slice of bread. It&#39;s fantastic (but a tad too expensive). <br><br>Anyways, the place is located right in Russell Square which is super convenience when leaving any of Birkbeck&#39;s buildings, and it&#39;s a quick place to stop and pick something up!",
