"reviewcomment":"The window had us in!<br><br>After walking by one afternoon we could not help but try this place! We had a mozzarella tomato and pesto ciabatta and a ham and cheese baguette. They both tasted delicious, fresh and hit the spot like a treat. The cake selection was great too we shared some black forest gateaux. I have had better but it was still tasty. The portion size I felt could have been a wee bit bigger. <br><br>The atmosphere in there was really good and the staff were really great. We sat down and ate. There&#39;s 3 massive benches at the back of the room (which is wonderfully decorated with the crazy light feature). So your sharing with fellow Londoner&#39;s which is not to much of a problem as the shear size of the tables stops it from being cramped. <br><br>The help yourself water station is useful for washing it all down.<br><br>As I was leaving walking round the corner I saw someone eating a slice cake in Del&#39;Aziz that must have been 3 times the size of mine! So will be trying there next!",
