"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/yLdfea7_9FvKJpNcDJfVFA/l.jpg",
"rating":"4.5",
"reviewcomment":"Based on the ridiculously good customer service that I just received at this Waitrose today, I&#39;m gonna go ahead with a very big 5-star rating!!<br><br>The story -- I&#39;m American, so finding sodium bicarbonate (baking soda) at a UK or Euro grocery store is a challenge like no other. It should be next to the flour and sugar, am I right Americans?<br><br>So, I catch a young female worker after combing the second aisle that I thought -might- contain this crazy item, and ask her &#34;where oh where is this sodium bicarbonate?&#34;. She directs me to the aisle that I was already in, but gives me a description of what it looks like. So, I head back and find it within a minute or so and move on with my shopping. (it wasn&#39;t far from the flour and sugar - doh!)<br><br>About 5 minutes later, I grab a spot in line to checkout and the same Waitrose worker pops up in front of me to show me that I had grabbed the gluten-free bicarb because there was none of the regular left on the shelf, which she realized after directing me there. She says &#34;that one is expensive, so if you don&#39;t need it I found more of the regular bicarb in the back&#34;. Can I just say, WOW?!?!<br><br>She had: 1. followed up on the direction she gave me, 2. realized that I may need help, 3. went in back to find the right item, and then - 4. FOUND ME in the store to give me the right item. I couldn&#39;t even stand it - and gushed all over her with thanks. This store is not small and it is not quiet, which means that she really went searching with armfuls of this product to make sure that she got it to me.<br><br>I&#39;m still happy about it. And I love this store. It also has every organic, diverse and good product you could possibly need. And delivers to your home if you like. And hires amazing staff, apparently. Thumbs up for Waitrose!!",
