"reviewcomment":"I love this place so much it&#39;s difficult to know where to begin! It has the most amazing food, cakes and coffee from the wonderful cakes to pies and sausage rolls plus a wonderful array of freshly made lunches - casseroles, special salads etc Everything is locally sourced where possible and of top quality. It&#39;s a deli as well as a coffee shop and it is one of my favourite things to go and buy a range of yummy treats from hoggity pies and game pies to home made fishcakes to have for dinner. They renovated the upstairs a while ago so there is now more seating space than there used to be which is great news as it&#39;s the perfect place to stop for a slice of Victoria sponge cake and coffee in the middle of the afternoon. You can sit by the window and watch the world go buy, lovely!<br><br> Handmade food is also a catering company so definitely worth looking at for any catering needs!",
