"rating":"4.5",
"reviewcomment":"Wing Yip is my little slice of Heaven. It&#39;s a small pilgrimage for me, and I go every one or two months to stock up. I always set a price limit for myself, and I always break it.<br><br>Having lived in Asia, it&#39;s great to find old loves and new ones among the rows and rows of aisles. My cheap large bottles of soy sauce, sticky vegetarian oyster sauce, frozen tempeh, fresh lotus root, and a case of discount TsingTao. All for me!  <br><br>They have a great range of frozen mock meats and I love their restaurant kitchen warehouse section as well. Steamers, bulk scrubby pads, chopping boards; I&#39;m stocked up! <br><br>In the supermarket area, but outside the tills, there are also other little shops. My fav being the knick knack shop because in the back they have books in English of Chinese lores, Buddhism and also children&#39;s books for learning Mandarin.<br><br>Stop at the in-house Reindeer Cafe before shopping so you don&#39;t go in hungry!",
"reviewcount":"6",
