"rating":"4.5",
"reviewcomment":"Upon moving to a new city it&#39;s important to watch for positive signs.<br><br>Here are a few that appeared for me today:<br>- Sweet potato falafel with houmous in a single serving container<br>- Madagascan vanilla yogurt<br>- Bombay Mix (a tasty snack composed of fried lentils, peanuts, chickpea flour noodles)<br><br>And all these signs turned up in the same place: the brand new branch of Waitrose in Clerkenwell! I wandered the aisles for far too long taking in all of the interesting offerings (and where the heck I am going to find tortilla chips because I couldn&#39;t find any here.)<br><br>We all create a sense of place in different ways. For me it&#39;s about finding a grocery store that &#34;gets&#34; me and Waitrose certainly does!",
