"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/D0-tQkUdpjM3F4j9qihQDQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Recently moved a few doors down the road, (used to be on the corner right opposite the station) the new shop is much nicer and bigger and now includes outside seating for the hot days. <br><br>We get our bread from here all the time, a truly great bakery with well made quality breads to suit a variety of tastes. The pastries are well made and the croissants are the biggest and best I&#39;ve ever tasted, and in my opinion, are worth the trip alone.<br><br>The service is good, but they can get very busy and run out of all the best food early so make sure you get there early for lunch. The sandwiches are great, using their own bread of course, freshly made and wholesome they make a great lunch, chicken / basil/ mayo is my favorite. Throw in a coffee and a croissant (or slice of the excellent Carot cake) and job done!<br><br>They take orders for cakes if you&#39;d like one for an occasion, and the staff are pretty clued up on the ingredients of everything, so they&#39;ll be able to advise you on any dietary requirements you may have. <br><br>Usually playing funky music (not so keen on the Jazz FM though) its always clean and pleasant to sit in or take your coffee round the park.",
