"reviewcomment":"Ah!  Le Pain Quotidien!  This is a favorite franchise of mine.  Love the rustic, natural wood interier.  Their Tartines are what I often go for, between the Avocado and Omega 3 or the Tuna and hummus.  A nice combination of ingredients and flavours that are simple and hearty.<br><br>I&#39;m often disappointed by the portions though.  They&#39;re quite small and a bit of an anti climax after you&#39;ve read the appetising description on the menu.<br><br>I nice selection of decent wines too.<br><br>Service is always friendly and efficient.<br><br>It&#39;s a nice atmosphere too.  A lively hum that&#39;s not intrusive which makes it an equally enjoyable venue if you&#39;re on your own or with company.",
