"reviewcomment":"Had a fabulous date night at the Warrington! I had the steak, which was absolute perfection. I was sad that it wasn&#39;t a thicker cut of steak, so I could savour it longer! The sauce that is served with the steak was to die for. So delicious! It comes with fat chips, which are totally yum! Be warned, the chilli chips will cause a fire to erupt in your mouth. They looked so harmless, but they are deceiving.<br><br>The Englishman ordered the fish and chips. I was shocked to see it was a whole battered fish on chips, served with mushy peas. I tried the mushy peas. They were delish. The serving size was huge. They could give you a bigger portion of the mushy peas though. <br><br>Before dining here, I thought the prices seemed a bit steep. Not outrageous, but reflective of being located in Maida Vale. I&#39;d say for what you get, it&#39;s actually good value for money. No wonder this place is always packed. YUM!<br><br>P.S. It&#39;s also a nice place to go for drinks. However, they don&#39;t make cocktails. You might be able to convince them to make you something simple, but be prepared for an alternative.",
