"rating":"4.0",
"reviewcomment":"I heart Ben&#39;s! <br><br>Huge, chewy, mounds of scrumptious goodness! We visited a couple of locations while on holiday in the UK. <br><br>I tried the following flavors: <br>Peanut Butter- This cookie was like a mini chewy cake of chunky peanut butter :) Moist with loads of peanut bits throughout.<br>Lemon- Tangy and sweet! Moist lemony cookie with a fresh citrusy flavor. <br>Dark Chocolate Chunk- Soft, chewy cookie with large gooey shards of dark chocolate chunks. <br>Oatmeal- Thick and chewy filled with oats, raisins and nuts.<br>Milk Chocolate Chunk- Pretty much the same as the dark chocolate, but with sweeter milk chocolate chunks.<br>Milk Chocolate Orange- Moist cookie with shards of gooey milk chocolate chunks and sweet candied orange pieces. <br><br>To note: The Oatmeal, Dark Choco and Milk Choco were brought back to the US and were still delicious! Moist chewy goodness even after 2 days!",
