"reviewcomment":"If you ever felt stranded in SouthWest London, in need for a quick Salt Beef / Corned Beef/ Pastrami / Pickled Fleisch fix, I have a tip for you.<br><br>On Saturdays, when there is the market on Northcote road, Dove sells &#34;smoked beef&#34; (one of the many variation on salt beef) on rye bread or bagel outside the shop!<br><br>5 quids for a bagel, 6 quids for a sandwich.<br>Both are rather small, but the meat is excellent.<br><br>No need to travel to North London, extra transgression points for buying your pastrami on Saturday, and you even get to eat it in the street and rub it in the face of all the people queuing for a way pricier burger at Byron&#39;s ...<br><br>Life is good again.",
