"rating":"4.0",
"reviewcomment":"When is a greasy spoon not a greasy spoon?<br><br> When it&#39;s not greasy.<br><br> Don&#39;t worry, that wasn&#39;t a joke. It&#39;s a comment on the greasy-ness of Andrews. For a place that serves greasy-spoon staples there is a surprising lasck of grease. No bad thing - it&#39;s often the artery clogging element to the food in these kinds of places that makes me avoid them. Thankfully Andrews seems to be able to cook a damn fine English breakfast without it being drowned in a pool of cholesterol.<br><br> There is plenty of choice on offer - jacket potatoes, omelets, burgers etc - all available for less than you would expect (Grays Inn Road is plagued by places selling £5 plus sandwiches - a hot meal for less is amazing!) and served hot and fast. Last time I went in I had a side of chips - chips that were on a par with classy upscale restaurants.<br><br> It&#39;s always busy here - a sign of its quality - so you may end up sharing a table with someone - but thats part of its charm. It&#39;s an old school establisment and doesn&#39;t try to be anything else.",
