"reviewcomment":"I admit it I&#39;m a snob and I love waitrose. <br>Having lived by Holloway Road for 4 years I have the choice of the tesco metros, sainsbury locals or for a bigger shop Morrisons or waitrose. I cannot stress the difference between Morrisons and waitrose on Holloway Road. They are like a different world yet so close physically. One is a nice relaxing experience with beautiful food, beautiful people and slightly inflated prices. The other is not and is a horrible experience that you only tolerate for the lower prices. <br><br>I personally would rather just relax whilst shopping, not have to que for ages and pay a fraction more for the pleasure. But occasionally I&#39;ll do a big bargain shop and instantly regret it and get in an argument with some idiot in Morrisons that often is someone that works there!",
