"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/6l9O125xl2h3aQSdQuS7dA/l.jpg",
"rating":"4.0",
"reviewcomment":"It was cold and rainy and I needed chocolate! <br><br>I stopped in here initially because of the free O2 offer. As soon as we walked in we were greeted by a super smiley man who had a tray of caramel salted chocolates! I wish every shop greeted me like this. <br><br>After getting the O2 offer, we decided to stay out of the rain and get a drink. My other half had a cappuccino and upon the recommendation of the smiley server I got a caramel chilli hot chocolate. It was delicious! It wasn&#39;t the normal over sugary hot chocolate you get at coffee shops, this was a full on cocoa explosion in my mouth. The sweetness of the caramel hit the tip of my tongue and the chilli left a nice tingly feeling as it travelled down my throat.<br><br>The chocolate was delish, the venue cool, and the people lovely. I&#39;ll defo be back.",
