"rating":"5.0",
"reviewcomment":"What a find Crepe Fun-Tastic is, hidden in a small outlet next to Victoria underground. It&#39;s open late, serves a range of good value (£4-£6) sweet and savoury crepes amidst a multi-coloured interior and the staff are very friendly. <br><br>I went for a simple, Nutella-only sweet crepe, but it was delicious. I also liked the fact that it was cheaper to eat-in, as takeaway means they &#34;have to provide a bag.&#34; So Crepe Fun-Tastic even scores on the environmental front! As others have said, the owners are Hungarian, reflected in the Hungarian rock (and Rasmus) soundtrack, and the atmosphere is really welcoming.<br><br>The small, sheltered restaurant also acts as providing a quiet haven from the hubbub immediately outside. I work nearby, and I can see Crepe Fun-Tastic being a new lunch place for me.",
