"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/z8Z8sCPoNYs4n58ha9_V7Q/l.jpg",
"rating":"4.0",
"reviewcomment":"I took my boyfriend to Aurora Soho for a surprise birthday treat and it was just that! After reading Jay Rayner&#39;s brilliant review in the Observer, I thought this would be a perfect place to spend a romantic evening celebrating a special birthday, and I wasn&#39;t disappointed.<br><br> From the moment I called to make a reservation to leaving at the end of the night, the staff were superb - friendly, hospitable and couldn&#39;t do enough for us.<br><br> Aurora is a small, warm and very welcoming restaurant serving delicious, locally sourced, fresh food.<br><br> The interior of Aurora is painted in a lovely bohemian blood red (as Jay describes it!) with candles and lillies adding atmosphere and a beautiful scent! The chairs and tables are all authentically old school; wooden seats with leather pads and arranged in intimate groups and alcoves which makes for a great intimate atmosphere.<br><br> We ate upstairs, however I believe there&#39;s also a downstairs eating area and in the summer people rave about the beautiful courtyard garden as a perfect place to lunch and enjoy when we have some sunshine!<br><br> The food is a mix of traditional british fare, with a twist. Aurora offer a great mix of meat, vegetarian and fish mains which are all reasonably priced for this jewel of a find in Soho. We ordered the Steak and Swordfish which came with a selection of seasonal veg - both were cooked to our liking and tasted wonderful. The deserts are to die for - we shared a beautiful homemade cheesecake (which is just right after a sizable main!).<br><br> Our booking did have a 2 hour table limit, but there was enough time to savor the food and atmosphere without feeling rushed or hassled to leave.<br><br> A great little find for any foodie looking for quality in Central London!",
"reviewcount":"13",
