"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/DIT7tiblQTEDdJ7brudJgA/l.jpg",
"rating":"4.5",
"reviewcomment":"Oh man, I just read an article that mentioned sfogliatelle and it reminded me of how much I yearn to visit the Exeter Street Bakery again. It is by far the best Italian bakery in London! Their sweet sfogliatelle are scrumptious, finger licking good. They have AMAZING rolls with added ingredients such as herbs or raisins. Their flat breads are out of this world. I would often order pizzas to bring to girlfriends&#39; apartments when we had a wine and pizza night in. My fave were the slices of onion and rosemary pizza. But seriously, they were all good. <br><br>Another good plan is to visit the cafe on a weekend morning, order a cafe latte (also excellent), and sit outside with a muffin or other such pastry (namely: panettone) to watch the people go by on nearby Kensington High Street. The coffee is rich, not burnt, creamy. I spent (and gained!) a lot of pounds and a lot of hours here, but it was always worth it! I can&#39;t wait to make a trip to London again. Exeter Street will definitely be the first stop on my list.",
