"rating":"4.0",
"reviewcomment":"Ideally located right outside the exit of the Eurostar, this is the place to come to if you feel like a delicious breakfast or a light lunch. <br><br>The wooden decor gives a cosy feeling to the place. The menu offers a large selection of breakfast options. You can share a basket of various breads and try out their numerous spreads : apricot jam, marmalade, speculoos spread or even white or dark chocolate flavours. You can also order the usual French croissant or a soft-boiled egg. <br><br>If you are after a light lunch, they serve some delicious soups and tartines with bacon, chicken and all sorts of veggies. <br><br>You might have to queue for a few minutes as the place is quite popular but they usually serve relatively quickly. They also have large tables if you come with a group, which is quite convenient. There is still enough space around if you do not feel like interacting with your neighbour. <br><br>If you are in a hurry, you can also buy a croissant, pastry or a sandwich at their store next door.",
