"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/lXQv34tEXsWLWvhDHssBOQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Mmmhmmm gobble mumble crumble mmmmmrhph! For the few who didn&#39;t get it: this was my famous cookie monster impersonation. I don&#39;t do it often but when i do ... ohh I tell you ... the sight is marvelous.<br><br>This cafe gave me plenty of opportunity to perfect my impersonation. I got the most amazing luscious brownie, plus a nice latte and I was sitting in the sun reading the Night Circus. What a perfect way to spend a lazy Saturday afternoon.  <br>The whole place looks cute, which mismatched chairs and tables. It has drawings on the windows, which are changed according to the seasons. At entering I immediately I saw the amazing cakes on the counter, fighting for my attention next to the brownies and some nice salads. On top of that one can order American pancakes until 1pm. I haven&#39;t tried them, but I saw them in passing and it was love at first side. I just hope to see them again so I can confess my feelings. <br><br>They also have take away and during the week they offer a pastry plus a coffee for under £3 and they offer free wi-fi. All around great cafe!!",
