"reviewcomment":"we sat outside with the pup for a brunch/lunch in the cold autumn sunshine. it&#39;s a perfect people watching spot along in primrose hill. the menu was really appealing to me - lots of great veggie options ranging from breakfasts, baguettes, baked potatoes, salads and sweet treats. their coffee is monmouth coffee so you are also assured of a lovely cuppa. <br><br>i ordered the halloumi salad which came with hummus and pitta - at £9.75 it wasn&#39;t the cheapest salad i&#39;ve ever had, but i was definitely happy with the serving size and the fresh ingredients. my boyfriend had poached eggs on a bagel - the tiny serving of rocket it came with seemed a little pointless, but aside from that the eggs were perfectly poached and he enjoyed it a lot. <br><br>the girls and guys serving were friendly and quick, and fellow diners were super friendly - which seems to be a recurring theme when you are dining with a cute puppy in tow!",
