"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/s8dLoOnCVN1NcEirWYwwQA/l.jpg",
"rating":"4.5",
"reviewcomment":"This place definitely gets a 5!  After being in Europe the last week or so, I was feening some asian tea... a friend of mine recommended this place in London, and I was not let down!  It&#39;s a very very small shop, meant to be just taken to-go.  Although they do have a small bench on the side of the shop for you to sit and wait for your drink.<br><br>I opted for the Peach Oolong Tea with Aloe Vera half sweetened (I think that&#39;s the one I chose, lol... Europe is becoming to be a bit of a blur) since I tend to not have much of a sweet tooth.  I explained to the lady that I tend to like my tea kinda as is and only very slightly sweetened... and I was so surprised when the lady who made my drink even let me sample the sweetness of my tea before putting it in a cup.  WUT?!  No tea place has ever let me sampled their drinks before serving it to me!!!  Super, super plus for that!  Anyways, super tasty, and just the perfect amount of sweetness for me!  They had good, small chunks of aloe which paired perfectly with my peach tea.  c:<br><br>My friend also told me that the owner of this shop also was a martial arts master!  Not sure if that&#39;s entirely true, but him being an avid regular of this place ... I don&#39;t disbelieve him.  The owner even looks the part (even if he wasn&#39;t a martial arts master)... so cool!   Hahah.",
