"rating":"5.0",
"reviewcomment":"These guys know what they&#39;re doing. The selection of beer here comes from across the world, with an uncanny knack of picking out the very best of beer to be found near and far. There are bottles of excellent local brews Sambrook Wandle and Junction, German alcohol-free beer (the best on the market, in my opinion) Erdinger Alkohol Frei and, (voice aquiver) two bottles from star Danish brewery Mikkeller. Plus a good selection of beer from Belgium, England, Austria, the Czech Republic and more (much of which I didn&#39;t recognise), all at reasonable prices.<br><br>The shop itself is worth a mention too: wood panels everywhere, with the beer bottles presented neatly on shelves. Throw in the friendly service and slow trumpet jazz sountrack playing softly in the background and it&#39;s very difficult to leave the shop without buying something. Which considering the quality of the produce on offer here, is no bad thing.",
