"reviewcomment":"Okay  first of all: I love cupcakes and I love Primrose Hill  so in my case, this place is THE place to be in order to enjoy a lazy sunday afternoon. <br>Sitting at the window, reading a book and eating a lemon cupcake, I really had a great time at Sweet Things. <br>I already came back to show this place to my boyfriend, who doesn&#39;t eat lots of sweets: He actually liked it. A lot. So I have to say: Bravo, well done!!<br>It won&#39;t be a big surprise for you now, that I&#39;m happy to recommend Sweet Things to you. <br>By the way: This is my first review in english - I thought it&#39;s appropriate  considering that I stay in London for six months and that from now on, I&#39;ll be a regular guest at this lovely cupcakery.",
