"rating":"4.5",
"reviewcomment":"Mizuna is one of my favorites if I happen to be in the area during lunchtime. I&#39;ve only had their salads (personal favorite is the peruvian with chicken), but they are fresh, cheap, and delicious. For such a small cafe, they have a pretty extensive menu with a number of different salads/wraps/etc that I don&#39;t think you can ever really get bored. I&#39;ve been here with people who&#39;ve had their jacket potatoes as well as their wraps and everyone seems to have nothing but positive things to say about this place. <br><br>The staff here is very pleasant and helpful - they don&#39;t make a fuss if you want to make substitutes (you can also completely customize your order). The queues do get pretty crazy after 1pm so come before to avoid the rush if you can. <br><br>Another thing to say is that this is a very small cafe. They have a few counter seats and then two tables outside, so I don&#39;t think this is very good place if you&#39;re planning to come and sit - I&#39;d say it&#39;s best for take away. <br><br>Most items come in under £5 so if you&#39;re looking for quality and value, definitely keep Mizuna in mind.",
