"rating":"4.5",
"reviewcomment":"MISSION COMPLETE. To try all three nordic bakeries in London, why? BECAUSE I CAN AND I&#39;VE DONE IT NOW. <br><br>I was actually walking from great portland street to the office, cutting through marylebone high street, and lo&#39; and behold, I smelt a tempting sexy smell, something that reached out to my base instincts. Cinnamon, I turned around and looked, and looked again. And, there it was, the source of the smell, the familiar sign, Nordic Bakery. I can&#39;t even begin to tell you how happy I was. <br><br>Since, I was on my way, I grabbed a cinnamon bun to takeout and it was warm, gooey, cinnamony and my life just felt complete. It stuck to the paper bag, but that just makes it that much more sexy when you peel it away. Nothing could take my happiness away that day, not even a closet to clean.",
