"reviewcomment":"I love farmers&#39; markets, and Bloomsbury Farmers&#39; market is no different! <br><br>It&#39;s located next to a lot of busy locations, and when we arrived at 12:30 to find something for lunch, there were already a lot of people around (and it&#39;s the summer, so I imagine it will get worse. Although given it&#39;s the summer people are more likely to want to go outside.)<br><br>There is a variety of goodness here from things to eat for lunch to things to take home and eat later. There are cake stalls and fruit stall and bread stalls and all sorts of stalls.<br><br>I had the lamb sandwich and the lamb was super tasty with a sweet chilli sauce (it was supposed to be jelly, but with the heat...)<br><br>I&#39;m sure we&#39;ll be back to try the other goodness that they have (the burgers and sausages have my name on them......)",
