"rating":"4.0",
"reviewcomment":"Talk about a fortuitous encounter.<br><br>12 hours left in London, an empty stomach, and £9.39 to my name. I needed something that would both satiate me for the moment and leave me enough to have something resembling breakfast tomorrow before hopping on the Tube to Heathrow. Enter the Bagel King, where I obtained a hot lamb samosa for the most attractive sum of £1.10. It was greasiness incarnate - seriously forcing me to reevaluate the meaning of the word as I knew it - but for all that it was hearty, spicy, and exactly what my grumbling stomach needed. Also, it was roughly the size of my face. You can&#39;t beat that, now.<br><br>So thanks go to the Bagel King, whom I shall remember dearly next time I find myself in the armpit of Elephant &amp; Castle.",
