"reviewcomment":"Ah the joys of birthdays. If it wasn&#39;t for my birthday, I wouldn&#39;t have found out about this little gem. One of my work colleagues bought me some Bee Heaven Farm Orchard apple juice from here for my birthday and I found the Hive Honey Shop from the label<br><br>Located on the foodie-centric Northcote Road with its open-air market, this shop is an amazing treasure trove of anything to do with honey. There&#39;s even a 5 foot high glass-fronted beehive, which is home to 20,000 live bees. You can watch them hard at work<br><br>You can get anything from honey to cosmetics to candles here. Even Winnie the Pooh would be sated!",
