"rating":"4.5",
"reviewcomment":"Why this coffe shop hasn&#39;t made it onto Qype earlier I&#39;ll never know! <br>It&#39;s a small Italian espresso bar and shop in the front corner of the Stables Market ( well, Camden Lock Place actually) with the best service ever! Yes, you do wait a while for the artistry of their espresso-based drinks with perfectly-frothed milk to be ready - but it&#39;s so worth it. <br>As tourists and locals alike huddle patiently in the &#39;shop&#39;, they can browze seemingly hundreds of varieties of loose-leaf tea and roasted coffee beans to take home. There&#39;s even those pretty chinese hand-made tea bombs that slowly unfurl in hot water to reveal coral-like garlands and explosions.<br>Anyway, on Saturday afternoon after freezing up the high street, I was presented (after my 15 minute wait) with the prettiest latte EVER! A delicate caramel flower drizzled on top sprinkled with edible purple glitter.<br>POW!<br>Go now! HURRY!",
