"ogimage":"http://s3-media3.ak.yelpcdn.com/assets/2/www/img/76df14aad260/default_avatars/business_large_square.png",
"rating":"4.5",
"reviewcomment":"What is strange is that many people swear they love coffee, but then go to Nero, Starbucks or somewhere else the beans are older than Jules Verne and the milk varies between surface of Mercury hot or scarcely distinguishable from room temperature. It really does astound me.<br><br>Thankfully, this tendency leaves room for smaller places like Sacred to make great coffee to those who are happy to search for it. Freshly roasted, ground and prepared coffee is all you are going to get here, with witty conversation from the Baristas who themselves are as great as the coffee. <br><br>Always go out of my way to come here and this Kiosk, uniquely located on the sidewalk, is a lifesaver when needing a fix of coffee which has been truly prepared, not just thrown in a cup.",
