"reviewcomment":"If you like nuts you will adore The Nutcase. If you like shop names that have a terribly cheesy pun you will love The Nutcase. If you&#39;re not fussed on either then you might not like The Nutcase. They have an amazing selection of nuts. Roasted, toasted, salted, sweet, chilliyou get the gist. But even if you do get the gist, you can&#39;t really appreciate how wonderful the selection of nuts truly is until you go there.<br><br> I even enjoy just walking past and enjoying the nutty waft that emits from the shop. The prices are fairly reasonable and you choose whatever and how much you like. The staff can be a little strange sometimes, but in a charming and intriguing way.<br><br> They additionally do a good line in Arabic coffees and sweets which make great gifts.",
