"rating":"4.5",
"reviewcomment":"We were at a trade show at nearby Alexandra Palace and walking back home we discovered this little gem of a Japanese grocery shop/take-away place. <br><br>Right when I saw the sign from afar I had an inkling that we&#39;d be in for a treat. And we were indeed: when we walked in, the pleasant smell of a sushi bar greeted us and led us directly to the heart of the shop: the counter with the sushi rolls &amp; sashimi on display. Right beyond it, you can witness the busy staff making the delicious treats. (Open kitchens like this - to me - are always a sign of good quality. It&#39;s basically saying: we have nothing to hide!)<br><br>And indeed, the salmon hand roll we had for take-away was a revelation in itself: fresh, sweet-tasting and absolutely delicious. The wasabi that came with it was pungent and we didn&#39;t even need any soy sauce - it was good in its own right!",
