"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/ZKn0OjA9mFJGclbDqUe6cg/l.jpg",
"rating":"4.5",
"reviewcomment":"Moulin Rouge is a saviour for most of us at my workplace as it is located a stone&#39;s throw away and the service, food and prices are all wonderful but more importantly it&#39;s a decent independent eatery which is rare around these parts! It&#39;s so good that it is rare to go in and there not be people there, in a good way because it&#39;s popular not in a queueing because of the slow service kind of way. <br><br>The service is quick, polite, friendly and efficient and after a couple of visits, you&#39;re treated like a regular by the lovely staff and owner who are all so nice! <br><br>The food is delicious and what I would describe as the main meals, for example to name just two dishes the Chicken Biryani and Moussaka both of which are really tasty, are so filling that often if I eat them for lunch I do not need to eat a main meal, just a snack, for dinner as I&#39;m still usually so full! There also have a wide range of sandwiches, wraps and baguettes with lots of of different fillings to choose from. Similarly, the salad bar is full of variety and tasty delights, including one of my favourites - dolmades (the Greek dish vine leaves). I can also recommend their bacon sandwiches and freshly squeezed orange juice, both of which I&#39;ve sampled en route to work when feeling slightly the worse for wear....<br><br>Finally, the prices are extremely reasonable and exceptional value for money, you almost feel rude paying just 4 shiny pounds for one of their main meals. <br><br>Located on Park Road, close to Baker Street tube and station and Regent&#39;s Park.",
