"reviewcomment":"LOVE this little health shop in West Hampstead that makes me feel like I&#39;m back in my little granola hippie town in Northern California...<br><br>Peppercorns has so much under one roof, I don&#39;t know how they do it! So don&#39;t be turned away by it&#39;s itty bitty size, there is actually quite a lot in store! Everything is crammed to the ceilings with lots of options and choices. Wonderful baked goods, teas, cereals, vitamins, and lots of great refrigerated and frozen treats as well. They also have the best veggie burger selection I&#39;ve seen in the city! If you are veggie, vegan, gluten-free, or simply health conscious, Peppercorns is your place. <br><br>I could spend forever in this little shop just getting my granola on. Ah, Peppercorns, I love you.",
