"rating":"3.5",
"reviewcomment":"Most important thing first: They do NOT except credit cards...which meant we had to go back out and get money from the station nearby, as I&#39;m the modern type of girl, which has only plastic. Same for my friend. Good news: they believed in our honesty and that we would return to pay the bill ... which we did.<br><br>Next to the staff, the place is also nice. It&#39;s not very big, but has some seats outside (back and front) for you smokers out there. It has a mixture of normal cafe chairs and some super comfortable arm chairs. The menu has a decent choice of food, starting from soup, over quiche, to wraps and cakes. I only tried the soup ... it was OK, but nothing to go back for. <br><br>I think I will tag this as a cosy place for a coffee and a chat, and maybe next time I will sample the cake. I will keep you posted on that.",
