"reviewcomment":"I popped into Konditor &amp; Cook very briefly to pick up some treats for a meeting I was headed to, but from what I saw, K&amp;C could quickly become a morning tea and cookie shop for me on my way to school. <br><br>They have a wonderful variety of baked goods, and all of their Christmas items are currently 20% off which makes it very tempting to stop in and pick something for sharing and enjoying. <br><br>I haven&#39;t had a sit down experience, so I can&#39;t comment much on the atmosphere, but it looked like a nice place to meet and warm up as the weather turns chilly. It&#39;s also a nice option on the Grey&#39;s Inn Road stretch there where there isn&#39;t a whole lot to choose from. Definitely worth repeating.",
