"reviewcomment":"What luck to have the best delicatessen in Streatham just a couple of streets away. Sunday breakfasts wouldn&#39;t be the same without fresh French bread and French butter, croissants, a piece of Reblochon when available, and a chunk of salami from Le Tour De France. They even have a Plat du Jour that you can buy whole or in part, which certainly goes down well with a bottle of their organic wine later in the day I particularly like the Choucroute Alsacienne which I eat with their pork rillettes and more French bread. And their vols au vents are a wonderful treat for afternoon tea in the garden with friends. Make a detour to Le Tour De France you won&#39;t regret it.",
