"reviewcomment":"Looks like an old school Italian deli from the outside - not the best bit of road in London to sell decent food from.<br><br> Very near to where I live - I drop in once a month or so. If you arrive early&#39;ish in the day they have a better choice.<br><br> But catering / family packs of fresh filled pasta are pretty good - hands down better than any supermarket variety.<br><br> Today I bought wet salt cod - not something you find everywhere. Some great looking and tasting home made pesto (in recycled jars 1 month shelf life. My daughter loves it), an obscure soup pasta that I have never seen, some italian butter (pale and beautifully packaged), and some aforementioned pumpkin ravioli.",
