"rating":"4.0",
"reviewcomment":"In a city not known for its dedication to fine beer Camden Town Brewery provides a welcome infusion of flavor, with the brewery bar serving as the center of Camden Town&#39;s welcome spread through London.<br><br>A small establishment tucked in an alley under the overground tracks, the selection here is unequaled even among bars that carry Camden&#39;s staples, Helles, Pale Ale, and Ink Stout.  Knowledgeable bartenders and patrons consisting of thosewho know that the best quality beer comes from the source make for a great atmosphere.  This strictly no-suits crowd are laid back and ready to enjoy themselves.  And while the bar itself does not have food the rotating lineup of some of London&#39;s finer mobile food establishments means that no one goes hungry.<br><br>For regulars and locals the growler refill station is a nice added bonus.",
