"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/tyQS4AMHRtGR9J6hiGLT-w/l.jpg",
"rating":"4.0",
"reviewcomment":"Oh me oh my, the cupcakes are just divine!<br><br>I saw this place on a weekend walk and looking through the classy window displays I saw tray of cupcakes and knew I would be back with my co-worker.<br><br>The interior of the place is very minimalistic, but warm. The glass case up front held an abundance of gorgeous looking desserts, but it was a mission for cupcakes that brought me here.<br><br>We selected the toffee, lemon, and raspberry cupcakes. All of the cakes were moist and the raspberry and lemon cakes had actual raspberries and cream in them. The toffee frosting was nice, it had a hint of coffee. The raspberry frosting again was nice, but  I could have done with a little more raspberry flavour and a little less sugar. My numero uno favourite one was the lemon. The frosting had a great balance of tang and sweetness and I probably could have eaten another one.... except that I will be bouncing around the walls in 10 mins from all the sugar!<br><br>If I am ever in Covent Garden and feel like tea and a pastry, I will be here in a heartbeat.",
