"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/SynVnPYaUlrJJw4zrKKANQ/l.jpg",
"rating":"4.5",
"reviewcomment":"Waitrose is, in my opinion, the best supermarket in Putney.<br><br> They have a bakery, fresh fish counter, fresh meat counter and delicatessens all on site  which for a small supermarket is really good. The nearest Asda for example (which is about four times the size) does not have a fresh fish counter at all. The range of fruit and vegetables is excellent, and all from reasonably local sources.<br><br> An extensive wine department can be found at the back of the store, which is better than some dedicated local shops like Threshers. The staff are all very helpful, and will even make wine recommendations.<br><br> Some complain that Waitrose is expensive. However, if you compare like for like products Waitrose is actually very competitive. But they don&#39;t sell any lower quality or value products, so if you do go here for every shop then it will end up costing more. They also don&#39;t have as many special offers as some of the other supermarkets.<br><br> Fresh flowers are located at the front of the store if you are looking for a gift, and they also have a reasonably large magazine section.<br><br> I find the isles in the store are wider than other supermarkets, which results in a less cramped shopping experience. The tills are always well staffed, so you never seem to have to queue for very long if at all. They will validate your parking in the Putney exchange car park if you spend more than £10.<br><br> An added bonus at the weekends is that a talented violinist often busks in Putney Exchange, who you should be able to hear while you&#39;re shopping or queuing.",
"reviewcount":"4",
