"reviewcomment":"The food is excellent, so it&#39;s definitely worth coming... but don&#39;t come here if you&#39;re feeling sensitive about noise levels, or quality of service, at the moment. Wait and come another time, when you&#39;re feeling less sensitive.<br>The entirely antipodean female staff does a decent job of holding it together, in the midst of what appears to be mild chaos and a substantial amount of disorganization.<br>It&#39;s definitely &#34;friendly and local&#34;, which is part of the charm of a London café anyway. High-quality ingredients made up for 30 minute wait for my eggs Florentine, although I did have to send it back to have them add the hollandaise sauce! The coffee was weak, but then West Coast strength coffee is not exactly a feature in London.<br>All in all, I liked it, and I would come back. But only if I was not in a hurry.",
