"reviewcomment":"A friend and I stumbled across chinwag after googling places to eat in new cross and since then we have returned several times. The decor is extremely quirky, the menus are handwritten into old novels, the tables and chairs are all mismatched, it&#39;s very inviting. The highlight of chinwag is without a doubt it&#39;s burgers. You NEED to try one. The beef burger was absolutely delicious, very tender meat, crunchy greens and you can choose a variety of add ons including bacon, a fried egg and grilled aubergine. The burgers are absolutely massive so you can easily share one between 2 along with a portion of delicious chips. The service here is great- the owners have been there everytime I&#39;ve visited and they often serve you your food. This place is definitely the best new cross has to offer in terms of lunch and I highly recommend it.",
