"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/1EfS7XaLhED949zbMMcnxA/l.jpg",
"rating":"4.5",
"reviewcomment":"I think that this small place deserves much more recognition and fame. Having the unfortunate placement near the trendy breakfast cafes around, many people just walk by it and don&#39;t give it a chance. Well, that&#39;s not me, I decided to give it a go a couple of months back and I still go there for breakfast when I find myself in Fitzrovia.<br><br>The space is nice and simple, not too grand or too shabby; just the right amount of comfortable. The staff is genuinely friendly and I always start my day nicely when I eat at La Mance. <br><br>The menu is lovely and has a good variety in eggs, that is of course if you like eggs. But who doesn&#39;t. Try the chorizo option - it&#39;s a bit spicy and so yum. Wash it down with a cup of coffee or a cup of freshly squeezed juice and you&#39;re set for the day.<br><br>Final words: if you are in the area and want a quiet place to have a lovely meal, definitely try La Manche.",
