"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/ySHPCkUdTvBxUxBvG2PXYQ/l.jpg",
"rating":"4.5",
"reviewcomment":"I grew up in Seattle, the city that brings you this little bite of digestible culture: <a href='/redir?url=http%3A%2F%2Fwww.youtube.com%2Fwatch%3Fv%3D72QTABuE0O4%26feature%3Drelated&amp;s=fb2e8a4ddd9a1f78df6de5fa8ac59e91bc04213605fbab5e7bd640bdca720552' target='_blank' rel='nofollow'>youtube.com/watch?v=72QT…</a><br><br>(Time allocated for those who skipped watching the video to go back and watch the frigggggin&#39; video. Do it.)<br><br>Aaaaand the plot thins when I insert the fact that I didn&#39;t eat fish until I was 20 years old. I thought it was vile. When I was 20 I went on a study abroad program called Semester at Sea, and as you can imagine... seafood was on the daily menu for six months.<br><br>After one month of eating the only non-fish alternative (peanut butter and jelly), I gave in. And I still haven&#39;t forgiven myself for wasting a full month not eating the most amazing, fresh, delicious fish I&#39;ve ever had. The reason it was so fantastic was that it was sourced directly from local fishers at each port we called at, so mahi-mahi in Cuba, piranha in Brazil, skate in Cape Town... all the way around to king salmon in Alaska.<br><br>My fish from Chelsea Fishmonger brought me right back to my earlier experience. So fresh, so local, so delicious. And most importantly, so ethical. I spoke with an employee for about 20 minutes about their fishing practices which involve, among other responsible things, only stocking fish caught by softer inshore non-destructive fishing methods. <br><br>Now I&#39;m not just upset about the one month I didn&#39;t eat fish on the ship, I&#39;m upset about the 20 years I didn&#39;t know places like Chelsea Fishmonger existed!",
