"reviewcomment":"I don&#39;t think I will ever buy my olive oil anywhere else. Sublime quality and the prices are rather cheap given such quality - I bought a litre of their very tasty, lovely and mild 2006 olive oil for £6. Their 2009 olive oil was £9 per litre, a real bargin considering what you pay elsewhere for a good cold pressed single estate extra virgin olive oil.<br><br> Check out the link to Mr Murat&#39;s website, they have a wide range of products and have a online shop.<br><br> I look forward to going back soon and hope that Mr Murat will be there; the person who served me on my first visit - while reluctantly offering advice on the different oils - was not very forthcoming and did not offer an olive oil tasting!",
