"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/kOywKgpNlCxufy-IGQ8Xgg/l.jpg",
"rating":"4.5",
"reviewcomment":"As someone who used to work round the corner from here and now considers this place to be the thing I miss most about my old job, I could wax lyrical about this place for hours.<br><br> One of a few independent sandwich shops on The Cut the Waterloo Sandwich bar is easily missed for those walking past the Young Vic. But it shouldn&#39;t be missed, not even if there&#39;s an inevitably long queue (it&#39;ll move quite quickly, promise). Here you&#39;ll find amazing baguettes, paninis and salads to order, all at relatively reasonable prices (i.e. cheaper than your nearby Eats and Prets).<br><br> As with the two previous reviews, I&#39;d recommend the amazing salad boxes, cramming pesto or chili chicken in with sweet potatoes, roasted veg, couscous and rice. Just don&#39;t try to fit it onto a plate when you get back to the office.<br><br> Or if you&#39;re after something to eat on the go, the chorizo baguette with gran padano and rocket was a personal fave of mine. Sigh.<br><br> There is space to sit down, but the place is so full of people trying to queue for great food that I wouldn&#39;t recommend it. Instead, I&#39;d say take it back to the office to make your Pret-munching colleagues nice and jealous.",
