"rating":"4.5",
"reviewcomment":"I really love this place. The people are friendly and dedicated to making a great cup of coffee. They don&#39;t just sell coffee, though. They&#39;ve got some really tasty breakfast bits (like musli, muffins, etc.).<br><br>There&#39;s also a broad range of personal coffee makers. From drip devices that make a single cup to my personal favourite--the aeropress.<br><br>Get some of their beans to take home. Ask them to grind them the way you need them ground. They&#39;re worth it. I promise you won&#39;t regret it.",
