"rating":"4.0",
"reviewcomment":"I walked past on Sunday after a heavy brunch in brick lane and I was like OOOF I SO CAN&#39;T MANAGE THIS. Luckily, 2 days later, they popped up at kerb at canary wharf, right under my workplace.<br><br>I was like, it&#39;s meant to be! And everyone else thought that too because it was BY FAR the busiest stall at kerb. It was snaking around by the time I left.<br><br>Not surprised either- a white bap with piles of pulled pork on top like the size of a small child&#39;s head. The pulled pork itself was tender, full of flavour and it worked well with their famous hot sauce! Could do without the bun, just the meat. Like a cave WOMAN style. yeah, its that good. <br><br>Beware, meat coma and meat sweats but regret. Never.",
