"reviewcomment":"This place is simply fantastic. I&#39;d almost go so far as to say it&#39;s a heaven on earth. Yes, it&#39;s only a supermarket and yes, it&#39;s more expensive than its competitor Sainsbury&#39;s just down the road but aaahhh, the advantages. The food selection is wide, as are the aisles, the staff are always friendly and the managers are paragons of customer service and charm. In fact, I sometimes wish I could take one home! If only more supermarkets were like Waitrose",
