"reviewcomment":"Cafe Marrone is my most recent go-to coffee spot! Lattes are super creamy. Add an extra shot &amp; it&#39;s the perfect strength for this poor jetlagged soul <br><br>Nice bold coffee flavor w/ no bitterness &amp; the uber-creaminess of the skim milk makes it so no sugar is even required! <br><br>When I first arrived to London &amp; finally hit my final destination, I realized I forgot to map out my route from the DLR to my friend&#39;s place - ack! <br><br>The nice folks here went onto their internet &amp; pulled up the map, gave me directions, then walked me out to make sure I was heading the right direction.....how nice!! <br><br>In addition to coffees, there is tea, sodas, juices, really good looking pastries &amp; sandwiches as well. <br><br>Internet kiosks, bar seats &amp; comfy chairs are yours for the choosing - grab a paper &amp; watch the busy people running to catch their train",
