"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/-0kM0kp6WbId0kmmO9bNuA/l.jpg",
"rating":"4.5",
"reviewcomment":"Allens of Mayfair is a traditional butcher&#39;s shop that specialises in game birds but also sells top-quality meats (beef, lamb, pork, veal) and a huge range of provisions.  <br><br>It may seem odd to describe a butcher&#39;s shop as beautiful, but I couldn&#39;t imagine a more atmospheric place to buy raw meat.  It helps that the shop has been nestled on Victorian red-bricked Mount Street since 1830 (now home to Balenciaga, Marc Jacobs, Christian Louboutin, Scott&#39;s restaurant, etc).  It also has huge windows facing the street and tiled walls adorned with hanging fowl and maturing cuts of beef.  And the friendly staff are experts.  Maybe not a vegetarian&#39;s dream, but I&#39;m a real fan.",
