"rating":"3.5",
"reviewcomment":"My favourite Patisserie Valerie. It&#39;s great for people watching. Really great. It&#39;s got all the posh people to nose on and they&#39;re are lots of fun.<br><br> The waiters make me laugh here. They take thier job very seriously which is really lovely. The guys here now how much work goes into the cakes and they like their jobs. That makes me happy. The service is better in here than any other branch in town.<br><br> Now, onto that cake. Wow. I could live in here. I&#39;d be fat, but I could live in here. I love their cakes so much and their hot chocolate is soooooo yummy. It makes me happy being in here. I sit by the window and read books and imagine what it would be like to have lots of money and only have to worry about what cake I should buy.<br><br> But I&#39;m also pretty happy to scrabble around in small change to pay for my second piece of cake too.",
