"rating":"4.0",
"reviewcomment":"Love love love this place! Stopped in here to get a coffee when I noticed it was actually a juice bar, something I&#39;d been craving all day. They do an array of blended juice drinks, all with cocktail like names, and a smaller selection of smoothies too. On top of that they do all your regular coffees, and a selection of fun sandwich combinations too. <br><br>When I sat down on one of their massive big couches I totally felt at home. It&#39;s one of those places you could sit for hours on a laptop working away. The decor inside is contemporary and classy and the food and juice is great. I went for the Joe&#39;s Sweet Kiss, which was strawberry, apple and ginger, and the Serrano sandwich, containing Serrano ham, tomato and mozzarella, with a green pesto dressing. Both of them were delicious and brought to my table by the wonderful server. Great place, a definite recommendation!",
