"rating":"3.5",
"reviewcomment":"Found a little piece of home beautifully tucked away in Covent Garden. Surprisingly I managed to actually get some nice weather here and after a long day exploring some of the most popular places around the city, I passed by this small (and cozy) spot and decided to give it a try. <br><br>The place is tiny but has a really nice feel to it, helped by the really nice choice of tables, huge windows facing the street and a beautiful display of their sweet and salty treats. <br><br>I ordered one of the most popular choices back home for an afternoon (or any time of day for that matter) snack: pão de queijo (or cheese ball) and a quindim for dessert (sorry but I can&#39;t remember its English name). Both were simply delicious and on par with some of the best I had back home! Definitely worth any £ spent on them and worth a visit if you&#39;d like to try them. <br><br>I had an opportunity to talk to Wagner, who seemed to be one of the owners, and he was very nice and attentive. <br><br>Definitely recommended! Love it!",
