"ogimage":"http://s3-media3.ak.yelpcdn.com/assets/2/www/img/76df14aad260/default_avatars/business_large_square.png",
"rating":"4.5",
"reviewcomment":"This is quite a nice Starbucks branch.<br><br> It is just off Oxford Street, round the corner from the Body Shop close to Bond St.<br><br> The toilet here is excellent, it is clean, there is usually no queue waiting to use it, and the staff are happy to let you use it without having to buy anything. I find this useful, as there are hardly any toilets that you can use for free around Oxford St.<br><br> The cafe itself is usually quite quiet, though it can get quite busy around the lunch-hours. The staff are brilliant, they are polite, and very quick at serving you your order, so you get a good drink, piping hot.<br><br> This is a good cafe to have a rest at half-way through a long-shop on Oxford St, and the seats at the back are quite comfortable.<br><br> The only problem with this place, is that due to the narrowness of the building, there is a bit of a traffic jam to get in and out of the cafe, as there isn&#39;t much space between the counter and the back wall.",
