"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/2POYnNuJxxH1WNAtiovcVg/l.jpg",
"rating":"4.0",
"reviewcomment":"Oh Hummingbird Bakery - how yummy and beautiful are your offerings! I&#39;m going to say straight up that I&#39;m not a huge fan of cupcakes. Sure, they&#39;re pretty but they are often liking eating sugary nothingness. The cupcakes, here, however transcend this and are genuinely moist and tasty. The carrot cake, red velvet and black bottom are highly recommended. I&#39;ve also tried the brownie with frosted topping - it&#39;s more cakey in texture than other brownies but the frosting complements it perfectly. <br><br>There are a few tables to sit in and I&#39;ve always found service to be friendly. It should be noted, though, that the coffee is not fantastic, so I&#39;d recommend sticking to the sweets. <br><br>It&#39;s worth keeping an eye on their Twitter feed for promotions and also monthly specials. I once indulged in an American brunch cupcake (bacon and maple syrup) - so wrong but oh-so-right!",
