"reviewcomment":"I&#39;ve been here when I was on holiday in London! The outside of the shop looked cosy and the cakes in front of the windows attracted us inside. <br><br>All the cakes looked very nice and I didn&#39;t know what to choose, in the end I went for the &#39;red velvet cake&#39;! It was certainly a good choice, because this cake ended up in my top 3 of best cakes I&#39;ve ever had! I think my mum chose a salted caramel cake and my partner chose a salmon sandwich. We all decided to go for coffee/cappuchinos that were also very good! We all loved everything!<br><br>The inside of the cafe was also quite lovely and it&#39;s also bigger than it looks from outside. If you ever are around brick lane (a place which I very enjoyed!) I really recommend going here!",
