"reviewcomment":"I like that when I visit H&amp;B I can ask almost any member of staff a question about their products and they have some knowledge - or just ask about general nutrition and they&#39;re happy to give advice - or just ask where something is and...you catch my drift, don&#39;t you? <br><br>It&#39;s a small/medium sized store, which was previously located in Moorgate. I&#39;ve bought slimming products, snack bars, vitamins, cereals, teas and, so far, everything I&#39;ve needed has been available. They also have a small cooler section which I noticed stocks meat alternatives and a wall almost solely dedicated to body building supplements (frequented by many a city gent I might add!). <br><br>It&#39;s worth popping in just for snacks as there&#39;s usually some sort of offer on and the price gram for gram is usually better than the small enticing packs you find near the counters of the nearby sandwich shops.",
