"rating":"4.5",
"reviewcomment":"BUT THIS IS A REVIEW FOR CAKE HOLE!<br>The tea shop in the back of the store. I didn&#39;t even pay attention to the quality of the store or items in the store because my friend brought me there strictly to have some tea and cake in the back. <br>Super friendly and funny staff. Good teas. We had to have a slice of the carrot cake which honestly was the best tasting carrot cake I&#39;ve ever had. And I&#39;ve surprisingly tasted a lot of carrot cakes in my life.<br><br>WARNING!!!: this place is mighty cozy so if you go there to have a super private personal conversation with someone you&#39;re out of luck. We were fortunate enough to snag a corner of a table that was already fairly stuffed.<br><br>They need to hurry up and setup their website. We were taking pictures and the woman behind the counter asked us to email them to her. we thought she was going to ask us to stop taking pictures. But they plan on putting up a section on their website of customer pictures. so cool. Excited to go back again.",
