"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/2w6wzFD5UhtiavSu3fo36A/l.jpg",
"rating":"4.0",
"reviewcomment":"This place is so darn cute. As cozy as your grandmother&#39;s living room but with a bit more chic. They offer a lot of cute tea cups, aprons and tea towels on sale. The display helps jazz up the place.<br><br>The servers are sweet and the drinks and bits come out fast. Today we ordered a strawberry and orange tea pot for two and a slice of lemon drizzle cake. Although the cake was a wee bit dry, the dryness made sense. The cake had a cornbread texture and it worked. The drizzle was tart and sweet. So a definite must-eat again dessert.<br><br>During a previous visit I had their scones with clotted cream and jam on the side. The scones were nice, moist. What stood out was that the clotted cream came in little packets. Here&#39;s this cute place that makes you think you&#39;re eating at your fancy nan&#39;s house and they give you cream in a packet? I would have preferred it served in a small dish, like the jam. <br><br>Definitely a place I look forward to returning to, especially with out of town guests.",
