"rating":"3.5",
"reviewcomment":"So the word on the street is that Shoryu has been opened by the Japan Centre, so off I went for lunch with a friend.<br><br>The place is sleek looking, black design, dual store space, although the tables are slightly cramped together. At lunch time it was super busy, must be a testament to how good its food is.<br><br>I believe I had the dracula ramen (can&#39;t remember - see photo) and I remember the broth was quite mild but I prefer this broth to the broth at Tonkotsu and at Bonedaddies. The egg however, pales in comparison to the runny yolk amazingness that is the egg at Bonedaddies. It is not too thick and creamy, how this compares to authentic Japanese I could not say, but it was nice and gentle to my sensitive stomach.<br><br>Drinks on the other hand could do with some work. My lunch mate&#39;s drink tasted horrible, and mine was just decent. It felt like too much ice went in so it went a bit too watery. Please introduce some nice drinks for people like me, I have a super sweet tooth. I do not really care that much if the drink is super unhealthy :)<br><br>Overall, I think I would come back here again, maybe to try the hirata bun, but Flesh &amp; Buns come first for that.",
